-- First table
CREATE TABLE booth (
  booth_number int NOT NULL,
  booth_price_level varchar(45) NOT NULL,
  booth_description varchar(255) NOT NULL,
  booth_type varchar(45) NOT NULL,
  PRIMARY KEY (booth_number),
  UNIQUE (booth_number)
);

